#using trie

class TrieNode:
    def __init__(self):
        self.neighbors = {}
        self.value = None

class Trie:
    def __init__(self):
        self.root = TrieNode()

    def insert(self, word):
        current = self.root
        for c in word:
            current = current.setdefault(c, TrieNode())
        current.value = word

class Solution:
    def palindromePairs(self, words: [str]) -> [[int]]:
        trie = Trie()
        for word in words:
            trie.insert(word)


